import {BrowserRouter, Routes, Router} from 'react-router-dom'
import Footer from './components/Footer';
import Hero from './components/Hero';
import Nav from './components/Nav';
import ShortenBox from './components/ShortenBox';
function App() {
  return (
    <div className="App">
     <Nav />
     <Hero />
     <ShortenBox />
    <Footer />
    </div>
  );
}

export default App;
